import React from 'react';

function Contact() {
  return React.createElement(
    'section',
    { id: 'contact', className: 'py-20 bg-gray-100' },
    React.createElement(
      'div',
      { className: 'p-8 max-w-3xl mx-auto text-center' },
      React.createElement('h2', { className: 'text-2xl font-bold mb-4' }, 'Contact Me'),
      React.createElement('p', { className: 'mb-2' }, 'Email: your.email@example.com'),
      React.createElement('p', { className: 'mb-2' }, 'GitHub: github.com/yourusername'),
      React.createElement('p', null, 'LinkedIn: linkedin.com/in/yourusername')
    )
  );
}

export default Contact;
